import { Link, Outlet } from "react-router-dom";
import { Fragment } from "react";

const Navigation = () => {
    return (
      <Fragment>
        <div className="navigation">
          <div>Logo</div>
          <div className="nav-links-container">
            <Link className="nav-link" to='/shop'>SHOP</Link>
          </div>

          </div>
          <Outlet />
      </Fragment>
    )
  }

  export default Navigation;
